import axios from "axios";
import React, { useState, useEffect } from "react";
import Button from "react-bootstrap/Button";
import Col from "react-bootstrap/Col";
import Form from "react-bootstrap/Form";
import Row from "react-bootstrap/Row";
import { Link, useNavigate } from "react-router-dom";
import { getuserservice } from "../services/user";
import Signnav from "./signnav";
import "../css/login.css";

function Loginhere() {
  const [obj, updateobj] = useState({ lemail: "email@gmail", lpwd: "gmail" });
  var navigate = useNavigate();

  const update = (event) => {
    var { name, value } = event.target;
    updateobj({ ...obj, [name]: value });
  };

  const loginwithquery = async () => {
    var url = "http://localhost:2002/user/login-with-query";
    var resp = await axios.post(url, {
      email: obj.lemail,
      pwd: obj.lpwd,
    });

    if (resp.data.status !== false) {
      localStorage.setItem("token", resp.data.token);
      localStorage.setItem("a_email", resp.data.user.email);

      if (resp.data.user.type === "Client") {
        navigate("/cdash");
      } else navigate("/pdash");
    } else {
      alert(resp.data.message);
    }
  };

  var token = localStorage.getItem("token");

  const getUser = async () => {
    try {
      // const resp= await axios.get('http://localhost:2002/user/currentuser',
      // {
      //     headers:{
      //         'Authorization':token
      //     }
      // });

      const resp = await getuserservice();
      alert("hlo" + resp);

      if (resp.data.status) {
        if (resp.data.user.type === "Client") {
          navigate("/cdash");
        } else {
          console.log("service-Provider");
          navigate("/pdash");
        }
      } else {
        alert(resp.data.message);
      }
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    if (token) {
      getUser();
    }
  }, []);

  return (
    <div>
      <div>
        <Signnav></Signnav>

        <div> <div class="main">      
    
    <section class="login">
       <div class="container">
           <div class="signin-content">
               <div class="signin-image">
                   <figure><image src="../images/signin-image.jpg" alt="sing up image"/></figure>
                   <Link to="/signup" class="signup-image-link">
                   Create an account
                 </Link>
               </div>

               <div class="signin-form">
                   <h2 class="form-title">Login</h2>
                   <form method="POST" class="register-form" id="login-form">
                       <div class="form-group">
                           <label for="your_name">
                           <image src="../images/user.png" height="10px" width="10px" alt=""/></label>
                           <input type="text" value={obj.lemail} name="lemail" id="your_name" placeholder="Email" onChange={update}/>
                       </div>
                       <div class="form-group">
                           <label for="your_pass"> <img src="images/key.png" height="10px" width="10px" alt=""/></label>
                           <input type="password" value={obj.lpwd} name="lpwd" onChange={update} id="your_pass" placeholder="Password"/>
                       </div>
                       <div class="form-group">
                           <input type="checkbox" name="remember-me" id="remember-me" class="agree-term" />
                           <label for="remember-me" class="label-agree-term"><span><span></span></span>Remember me</label>
                       </div>
                       <div class="form-group form-button">
                           <input type="button" onClick={loginwithquery} id="signin" class="form-submit" value="Log in"/>
                       </div>
                   </form>
                   <div class="social-login">
                       <span class="social-label">Or login with</span>
                       <ul class="socials">
                           <li><a href="#"><i class="display-flex-center zmdi zmdi-facebook"></i></a></li>
                           <li><a href="#"><i class="display-flex-center zmdi zmdi-twitter"></i></a></li>
                           <li><a href="#"><i class="display-flex-center zmdi zmdi-google"></i></a></li>
                       </ul>
                   </div>
               </div>

              
           </div>
       </div>
   </section>

    </div>
</div>

        {/* <center>
                 <h1>Login Here....</h1>
    
                 <Form method="get"  action="">
                  <Form.Group as={Row} className="mb-3" controlId="formHorizontalEmail">
                    <Form.Label column sm={2}>
                      Email
                    </Form.Label>
                    <Col sm={5}>
                      <Form.Control type="email" placeholder="Email" value={obj.lemail} name="lemail" onChange={update}/>
                    </Col>
                  </Form.Group>
            
                  <Form.Group as={Row} className="mb-3" controlId="formHorizontalPassword">
                    <Form.Label column sm={2}>
                      Password
                    </Form.Label>
                    <Col sm={5}>
                      <Form.Control type="password" placeholder="Password" value={obj.lpwd} name="lpwd" onChange={update}/>
                    </Col>
                  </Form.Group>

                  <Link to="/signup">
                    <h4>Signup</h4>
                  </Link>
            
                  <Form.Group as={Row} className="mb-3">
                    <Col sm={{ span: 5, offset: 2 }}>
                      <Button type="button" onClick={loginwithquery}>Login</Button>
                    </Col>
                  </Form.Group>
                 
                </Form>
    
    
                </center>*/}
      </div>
    </div>
  );
}

export default Loginhere;
